import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {
  render() {
    return (
      <div className="App">
        <header className="App-header">
          <img src={logo} className="App-logo" alt="logo" />
          <h4 classname="App-title"> Bem-vindo ao React</h4>

          <p classname="App-intro">
            Para começar, edite o arquivo <code>src/App.js</code>, salve e recarregue a página.
          </p>
        </header><b><a
            className="App-link"
            href="https://reactjs.org"
            target="_blank"
            rel="noopener noreferrer"
          >
            Aprenda React (em Inglês)
          </a></b>
      </div>
    );
  }
}

export default App;
